var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of an Oracle Navigator window.
 * @param {Object} [props] Initializes an NavigatorWindow test object using the supplied property bag.
 * @returns {Object} the description object that was initialized.
 * @class NavigatorWindow
 * @extends Oracle.UiObjectBaseDescription
 * @memberof Oracle
 */
function NavigatorWindow(props){
    var navigatorWindowDesc = new UiObjectBaseDescription("NavigatorWindow");

    navigatorWindowDesc._defineByPropertyBag(props);
    return navigatorWindowDesc;
}

/**
 * An Oracle Navigator window.
 * @constructor
 * @class NavigatorWindowTO
 * @extends Oracle.UiObjectBaseTO
 * @memberof Oracle
 */
function NavigatorWindowTO(session,description){
    description = description || NavigatorWindow();
    var navigatorWindowTO = new UiObjectBaseTO("OracleNavigator", session, description);
    return navigatorWindowTO;
}

module.exports.NavigatorWindowTO = NavigatorWindowTO;
module.exports.NavigatorWindow = NavigatorWindow;